About Game:
************
Solve the Puzzles Under The Hill with Pamela Possum so that she can meet up with her friend, Sammy Squirrel. These beautiful jigsaw puzzles are images straight from the National Gallery of Art! The puzzles will get progressively harder as you make your way through the game. Start putting the pieces together in Puzzles Under The Hill today!

